import React, { useState,useEffect } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {
    Card,
    CardHeader,
    Divider,
    Grid,
    CardContent,
    CardActions,
    Chip,
    IconButton,
    CardMedia,
    Typography,
    Button,
} from '@material-ui/core';

import EditOutlinedIcon from '@material-ui/icons/EditOutlined';
import DeleteOutlineOutlinedIcon from '@material-ui/icons/DeleteOutlineOutlined';
import { gridSpacing } from '../../../../store/constant';
import axios from 'axios';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import DoneTwoToneIcon from '@material-ui/icons/DoneTwoTone';
import CloseTwoToneIcon from '@material-ui/icons/CloseTwoTone';

import Phone1 from './../../../../assets/images/widget/PHONE1.jpg';
import Phone2 from './../../../../assets/images/widget/PHONE2.jpg';
import Phone3 from './../../../../assets/images/widget/PHONE3.jpg';
import Phone4 from './../../../../assets/images/widget/PHONE4.jpg';

const useStyles = makeStyles({
    table: {
        minWidth: 250,
    },
    imgproduct: {
        width: '20px',
        height: 'auto',
    },
});

const [data, setData] = useState([]);
const [value,setValue] = useState("");
useEffect(()=>{
 loadData();
},[]);

 const loadData = async() => {
 const response = await axios.get("http://localhost:5000/latestdata");
 setData(response.data);

 };


 useEffect(()=>{
    loadData();
 }, []);


function createData(cid, itemName, photo, location, quantity, date, status, statuscolor, verify) {
    // return { cid,  itemName,photo, location, totalStock, quantity, date, stockIn, StockOut };
    return { cid, itemName, photo, location, quantity, date, status, statuscolor, verify };
}

const rows = [
    createData('#81412314', 'Item A', Phone1, '1/2', '10', '17-2-2017', '4', 'secondary'),
    createData('#68457898', 'Item B', Phone2, '2/5', '16', '20-2-2017', '5', 'primary'),
    createData('#45457898', 'Item C', Phone3, '5/3', '20', '17-2-2017', '6', 'secondary'),
    createData('#62446232', 'Item D', Phone4, '8/45', '15', '25-4-2017', '6', 'primary'),
];

export default function LatestorderCard() {
    const classes = useStyles();
    const [val, setVal] = useState(false);

    return (
        <Grid container spacing={gridSpacing}>
            <Grid item xs={11}>
                <Card>
                    <CardHeader
                        title={
                            <Typography component="div" className="card-header">
                                Latest Update 
                            </Typography>
                        }
                    />
                    <Divider />
                    <CardContent className="p-0">
                        <TableContainer>
                            <Table  aria-label="simple table">
                                <TableHead>
                                    <TableRow>
                                        <TableCell>No.</TableCell>
                                        <TableCell>Item Name</TableCell>
                                        <TableCell>Item Image 1</TableCell>
                                        <TableCell>Item Image 2</TableCell>
                                        <TableCell>Item Image 3</TableCell>
                                        <TableCell>Date and Time</TableCell>
                                        <TableCell>Item Location</TableCell>
                                        <TableCell>Status</TableCell>
                                        <TableCell>Verify</TableCell>

                                    </TableRow>
                                </TableHead>
                                <TableBody>
                                     {data.map((item, index) => (
                                        <TableRow key={index}>
                                            <TableCell>{item.id}</TableCell>
                                            <TableCell>{item.label}</TableCell>
                                            <TableCell>
                                                <CardMedia
                                                    component="img"
                                                    image={item.img}
                                                    title="image"
                                                    // className={classes.imglocation}
                                                />
                                            </TableCell>
                                            <TableCell>{item.location}</TableCell>
                                            <TableCell>{item.quantity}</TableCell>
                                            <TableCell>{item.time1}</TableCell>
                                            <TableCell>
                                                <Chip color={item.statuscolor} label={item.status} size="small" />
                                            </TableCell>
                                            <TableCell>
                                                <IconButton color="primary">
                                                    <EditOutlinedIcon />
                                                </IconButton>
                                                <IconButton color="inherit">
                                                    <DeleteOutlineOutlinedIcon />
                                                </IconButton>
                                            </TableCell>
                                            <TableCell>
                                                <IconButton
                                                    color="inherit"
                                                    onClick={() => {
                                                        // rows[index].verify = !rows[index].verify;
                                                        setVal(!val);
                                                        rows[index].verify = val;
                                                    }}
                                                >
                                                    {item.verify ? <DoneTwoToneIcon /> : <CloseTwoToneIcon />}
                                                </IconButton>
                                            </TableCell>
                                        </TableRow>
                                                ))} 
                                </TableBody> 
                            </Table>
                        </TableContainer>
                     </CardContent>
                    <CardActions className="f-right">
                        <a href="/widget/data">
                            <Button variant="text" size="small" color="primary">

                            </Button>
                        </a>
                    </CardActions>
                </Card> 
            </Grid>
        </Grid>
    );
}
